INSERT INTO `tbl_tips` VALUES (1,'It\'s not about getting someone to think you\'re good enough for them. It’s about finding someone you can stand to spend a ridiculous amount of time with.','2015-09-07','2036-12-31',1,'2015-09-07 00:00:00','2015-09-07 00:00:00',0),(2,'Finding a romantic partner is only one of many goals you can have at once. There\'s a difference between making something a priority and having an obsession.','2015-09-07','2036-12-31',1,'2015-09-07 00:00:00','2015-09-07 00:00:00',0),(3,'Work on your gaydar. It\'ll make your life much easier.','2015-09-09','2036-12-31',0,'2015-09-09 00:00:00','2015-09-19 13:04:03',2),(4,'If you\'re bored out of your mind at the local bar on Saturday night, you\'re probably not going to meet anyone there who\'s going to liven up your evening.','2015-09-09','2036-12-31',1,'2015-09-09 00:00:00','2015-09-09 00:00:00',0),(5,'A first date is not an audition for marriage. It\'s just a tryout for a second date.','2015-09-09','2036-12-31',1,'2015-09-09 00:00:00','2015-09-09 00:00:00',0),(6,'Go to movies by yourself. The same goes for museums, parks and concerts. When you\'re part of a couple, you miss being free to follow your every whim.','2015-09-09','2036-12-31',1,'2015-09-09 00:00:00','2015-09-09 00:00:00',0),(7,'Stop worrying about potential paramours rejecting you for being too fat, too short, too whatever.','2015-09-09','2036-12-31',1,'2015-09-09 00:00:00','2015-09-09 00:00:00',0),(8,'If you want to succeed with a man or a woman don’t message him or her everyday.','2015-09-01','2036-12-31',1,'2015-09-16 09:05:01','2015-09-19 13:03:27',2),(9,'Take your time before replying to his or her message, never be in a hurry to reply to hir or her messages.','2015-09-01','2036-12-31',1,'2015-09-16 09:05:20','2015-09-16 09:06:03',2),(10,'If you want to succeed with a man or a woman don’t make your SMS too romantic.','2015-09-01','2036-12-31',1,'2015-09-16 09:05:31','2015-09-19 13:02:49',2),(12,'If you want to succeed with a man or a woman don’t make your SMS too romantic.','2015-09-01','2037-01-01',1,'2015-09-29 11:29:24','2016-02-04 17:43:36',1),(13,'when you get your soul mate always treat him/her like you still want to win that person\'s heart again....that\'s the key to a perfect relationship','2016-02-05','2016-02-12',0,'2016-02-04 13:10:51','2016-02-04 13:10:51',1),(14,'when you get your soul mate always treat him/her like you still want to win that person\'s heart again....that\'s the key to a perfect relationship','2016-02-05','2016-02-12',0,'2016-02-04 13:10:58','2016-02-04 13:10:58',1),(16,'The key to a longlasting relationship is based on good communiation skills let you and your spouse be free to talk about anything without hiding anything','2016-02-06','2016-02-13',0,'2016-02-04 13:15:18','2016-02-04 13:15:18',1),(17,'Always be the one to bring a smile on your spouse\'s face no matter the situation...that\'s what makes you special to them','2016-02-07','2016-02-14',0,'2016-02-04 13:18:56','2016-02-04 13:18:56',1);
